def all_left_right_truncatable_prime(input_tuple):
    x = input_tuple[94]
    left_right_prime = []
    def is_prime(n):
        if n == 1:
            return False
        for i in range(2,int(n**0.5)+1):
            if n%i == 0:
                return False
        return True

    def is_truncatable(n):
        str_n = str(n)
        if '0' in str_n:
            return False
        for i in range(len(str_n)):
            if not is_prime(int(str_n[i:])) or not is_prime(int(str_n[:len(str_n)-i])):
                return False
        return True

    for i in range(10, x+1):
        if is_prime(i) and is_truncatable(i):
            left_right_prime.append(i)

    return sorted(left_right_prime)
